import React from "react";
import { Link } from "react-router-dom"; // For navigation
import ""; // Import the styles
import backgroundImage from "../assets/background.jpeg"; // Import the background image

function WelcomePage() {
  return (
    <div
      className="welcome-container"
      style={{ backgroundImage: `url(${backgroundImage})` }}
    >
      <div className="overlay">
        <div className="welcome-content">
          <h1 className="welcome-message">Welcome to IdeaNexus!</h1>
          <p className="tagline">Connect. Create. Collaborate.</p>
          <div className="buttons-container">
            {/* Login and Signup buttons */}
            <Link to="/login">
              <button className="action-button login-button">Login</button>
            </Link>
            <Link to="/signup">
              <button className="action-button signup-button">Signup</button>
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
}

export default WelcomePage;
